function setup() {
  createCanvas(595.28, 841.89);
  colorMode(HSB, 360, 100, 100, 1);
}

function draw() {
  drawBackgroundGradient();
  push();
  translate(0, 0);
  scale(1.02);

  // Reconstruct once; keep stable order so indices don't change
  if (!__paths) __paths = groupSegmentsIntoPaths(segments);

  // --- Paint order: background -> silhouette -> planes -> cuts ---
  // A) Silhouette (fill)
  if (IDX.silhouette.length) {
    fill(COL.navy);
    noStroke();
    drawCompoundFill(__paths, IDX.silhouette, IDX.holesInSilhouette);
  }

  // B) Blue planes (filled shapes)
  for (const i of IDX.bluePlanes) {
    fill(COL.blue);
    noStroke();
    drawClosedPath(__paths[i]);
  }

  // C) Accent cuts (stroked only)
  stroke(COL.blueDeep);
  strokeWeight(3);
  strokeCap(ROUND);
  strokeJoin(ROUND);
  noFill();
  for (const i of IDX.deepCuts) {
    drawOpenPath(__paths[i]);
  }

  if (SHOW_INDEX_OVERLAY) drawPathIndexOverlay(__paths); // turn on to collect indices
  pop();
  
}

// ---------- Background gradient ----------
function drawBackgroundGradient() {
  // Normalize mouse to 0..1 (works even when mouse is outside the canvas)
  const mx = constrain(mouseX / width,  0, 1);
  const my = constrain(mouseY / height, 0, 1);

  // Use mouseX to steer hue, mouseY to steer saturation/brightness.
  // Feel free to tweak the ranges to taste.
  const baseHue = map(mx, 0, 1, 20, 220, true);     // leftright: orange  blue
  const sat     = map(my, 0, 1, 70, 90,  true);     // bottomtop: more vivid
  const bTop    = map(my, 0, 1, 95, 70,  true);     // top band gets darker as you go down
  const bMid    = map(my, 0, 1, 90, 65,  true);
  const bBot    = map(my, 0, 1, 80, 60,  true);

  // Create three stops. We offset hue a little so the gradient has color depth.
  const topCol = color((baseHue +  0) % 360, sat, bTop);
  const midCol = color((baseHue + 20) % 360, sat, bMid);
  const botCol = color((baseHue + 40) % 360, sat, bBot);

  // Draw vertical 2-phase gradient (topmidbottom)
  for (let y = 0; y < height; y++) {
    const t = y / (height - 1);
    const c = (t < 0.5)
      ? lerpColor(topCol, midCol, t / 0.5)
      : lerpColor(midCol, botCol, (t - 0.5) / 0.5);
    stroke(c);
    line(0, y, width, y);
  }
  noStroke();
}




// ---------- Data model helpers ----------
/*
Each "segment" is [x1,y1, cx1,cy1, cx2,cy2, x2,y2].
The SVG had 27 <path> elements originally. We infer path breaks
whenever the next segment's start is NOT close to the previous segment's end.
*/
function groupSegmentsIntoPaths(segs, jumpThreshold = 2.5) {
  const paths = [];
  let current = [];
  for (let i = 0; i < segs.length; i++) {
    const s = segs[i];
    if (current.length === 0) {
      current.push(s);
    } else {
      const prev = current[current.length - 1];
      const [px, py] = [prev[6], prev[7]];      // previous end
      const [nx, ny] = [s[0], s[1]];            // next start
      const dx = nx - px, dy = ny - py;
      const dist = Math.hypot(dx, dy);
      // If we "jump", we are starting a new path
      if (dist > jumpThreshold) {
        paths.push(current);
        current = [s];
      } else {
        current.push(s);
      }
    }
  }
  if (current.length) paths.push(current);
  return paths;
}

// ---------- Path drawing ----------
/*
Draw a CLOSED path (filled) by chaining bezierVertex().
Assumes the path is reasonably closed; we force CLOSE on endShape().
*/
function drawClosedPath(path) {
  const first = path[0];
  beginShape();
  vertex(first[0], first[1]); // moveTo (start)
  for (const s of path) {
    bezierVertex(s[2], s[3], s[4], s[5], s[6], s[7]);
  }
  endShape(CLOSE);
}

/*
Draw an OPEN path (stroked only).
(We don't CLOSE here; good for tiny accent cuts)
*/
function drawOpenPath(path) {
  const first = path[0];
  beginShape();
  vertex(first[0], first[1]);
  for (const s of path) {
    bezierVertex(s[2], s[3], s[4], s[5], s[6], s[7]);
  }
  endShape();
}

// ---------- Area approximation (for auto-color grouping) ----------
/*
We approximate area by flattening the cubic path into a polyline and
using the signed polygon area. Big positive |area| => likely a filled region.
This doesnt have to be perfectjust good enough to rank paths.
*/
function approxPathArea(path, stepsPerSeg = 12) {
  const pts = [];
  // sample each cubic segment into "stepsPerSeg" straight segments
  const last = path[path.length - 1];
  let prev = [path[0][0], path[0][1]];
  pts.push(prev);

  for (const s of path) {
    for (let i = 1; i <= stepsPerSeg; i++) {
      const t = i / stepsPerSeg;
      // De Casteljau evaluation of cubic Bezier at t
      const x = cubicAt(s[0], s[2], s[4], s[6], t);
      const y = cubicAt(s[1], s[3], s[5], s[7], t);
      pts.push([x, y]);
      prev = [x, y];
    }
  }

  // polygon area (shoelace)
  let area = 0;
  for (let i = 0; i < pts.length; i++) {
    const [x1, y1] = pts[i];
    const [x2, y2] = pts[(i + 1) % pts.length];
    area += x1 * y2 - x2 * y1;
  }
  return Math.abs(area) * 0.5;
}

function cubicAt(p0, p1, p2, p3, t) {
  const mt = 1 - t;
  return mt*mt*mt*p0 + 3*mt*mt*t*p1 + 3*mt*t*t*p2 + t*t*t*p3;
}

let __paths;  // cache so indices stay stable across draws

function drawPathIndexOverlay(paths) {
  textAlign(CENTER, CENTER);
  textSize(10);
  noStroke();
  for (let i = 0; i < paths.length; i++) {
    const p = paths[i];
    // faint random fill to see extents
    fill(0, 0, 0, 0); // keep transparent fill
    stroke(0, 20);    // light outline
    strokeWeight(1);
    drawOpenPath(p);
    // label at centroid
    const c = centroidOfPath(p);
    noStroke(); fill(0); rect(c.x-8, c.y-6, 16, 12); // label bg
    fill(255); text(i, c.x, c.y);                   // index
  }
}

function centroidOfPath(path) {
  // reuse approx sampler from before to get mean point
  const pts = samplePath(path, 10);
  let sx = 0, sy = 0;
  for (const [x,y] of pts) { sx+=x; sy+=y; }
  return {x: sx/pts.length, y: sy/pts.length};
}

function samplePath(path, stepsPerSeg=10) {
  const pts = [[path[0][0], path[0][1]]];
  for (const s of path) {
    for (let i=1;i<=stepsPerSeg;i++){
      const t = i/stepsPerSeg;
      pts.push([cubicAt(s[0],s[2],s[4],s[6],t),
                cubicAt(s[1],s[3],s[5],s[7],t)]);
    }
  }
  return pts;
}

// Fill one or more solids and subtract optional holes from each
function drawCompoundFill(paths, solids, holes) {
  if (!solids.length) return;
  for (const si of solids) {
    const solid = paths[si];
    beginShape();
    // outer
    vertex(solid[0][0], solid[0][1]);
    for (const s of solid) bezierVertex(s[2], s[3], s[4], s[5], s[6], s[7]);

    // subtract each hole (rare; usually you won't need this)
    for (const hi of holes) {
      const hole = paths[hi];
      beginContour();
      vertex(hole[0][0], hole[0][1]);
      for (const s of hole) bezierVertex(s[2], s[3], s[4], s[5], s[6], s[7]);
      endContour();
    }
    endShape(CLOSE);
  }
}



